-- ----------------------------
-- Procedure structure for sp_cmduser_flag_role
-- ----------------------------
DROP PROCEDURE IF EXISTS `sp_cmduser_flag_role`;
delimiter ;;
CREATE PROCEDURE `sp_cmduser_flag_role`(IN `nama_status` VARCHAR(13))
  NO SQL 
SELECT b.`id_user`,`username` ,`name` ,`flag_role`,
if(name='admin',concat(b.id_user,'/',name),
   if(name='verifikator',concat(b.id_user,'/',name),
      if(name='responder',concat(b.id_user,'/',name),''))) as gab_flag_role,
`nama_posisi`

FROM users b join roles c join ms_pengaduan_posisi d on d.`parent_id`=b.id_user where username is not NULL and (concat(name,substr(flag_role,1,1))='admin1' or concat(name,substr(flag_role,2,1))='verifikator1' or concat(name,substr(flag_role,3,1))='responder1')
and name=nama_status
order by username
;;
delimiter ;

-- ----------------------------
-- Procedure structure for sp_tr_pengaduan
