DROP PROCEDURE IF EXISTS `sp_tr_pengaduan`;
delimiter ;;
CREATE PROCEDURE `sp_tr_pengaduan`(IN `jenis` INT(4), IN `status` INT(4), IN `kanal` INT(4))
  NO SQL 
select * from tr_pengaduan where jenis_id=jenis
and status_id=status
and kanal_id=kanal;
;;
delimiter ;

SET FOREIGN_KEY_CHECKS = 1;
